import React from "react";
import "./App.css";
import useExchange from "./data/useExchange";
import { crypto } from "./data/data";

const App = () => {
  const rates = useExchange();
  const baseCurrency = rates.base;
  const btcAmount = crypto.amount;
  const btcCurrency = crypto.currency;
  console.log(rates.rates.AED);

  return (
    <div className="App">
      {btcAmount} {btcCurrency} = {baseCurrency} {baseCurrency}
    </div>
  );
};

export default React.memo(App);
